  const openNewTab = (url) => {
    window.open(url, "_blank", "noreferrer");
  };

  return (
    <table style={{ width: "100%", border: "1px solid black" }}>
      <tr style={{ width: "100%", border: "1px solid black" }}>
        <th style={{ width: "100%", border: "1px solid black" }}>Company</th>
        <th style={{ width: "100%", border: "1px solid black" }}>Contact</th>
        <th style={{ width: "100%", border: "1px solid black" }}>Country</th>
      </tr>
      <tr style={{ width: "100%", border: "1px solid black" }}>
        <td style={{ width: "100%", border: "1px solid black" }}>Alfreds Futterkiste</td>
        <td style={{ width: "100%", border: "1px solid black" }}>Maria Anders</td>
        <td>Germany</td>
      </tr>
      <tr style={{ width: "100%", border: "1px solid black" }}>
        <td>Centro comercial Moctezuma</td>
        <td>Francisco Chang</td>
        <td>Mexico</td>
      </tr>
    </table>
  );
};

export default UniversityPage;
